YUI.add('srpl-business-templates', function(Y){
// DO NOT EDIT THIS FILE
// this should be automatically generated by using the .*.html files in templates
Y.namespace('srpl.Business');
Y.srpl.Business.templates = {
    description:Y.template('<% if (b.get(\'overview\').long_desc && !Y.Lang.isObject(b.get(\'overview\').long_desc)) { %>\n<div class="srpl-container">\n    <h6><%= b.get(\'overview\').long_desc %></h6>\n</div>\n<% }%>'),
		details:Y.template('<% if (b.get(\'overview\')) { %>\n<div class="srpl-container srpl-detail-container">\n    <% if (!Y.Lang.isObject(b.get(\'overview\').hrs)) { %>\n    <div class="yui3-g srpl-content-container">\n        <div class="yui3-u-1-4">Hours</div>\n        <div class="yui3-u-3-4">\n            <%\n            Y.each(b.get(\'overview\').hrs.split(\',\'),function(h,i){\n            %>\n            <p><%=h%><p>\n            <%\n            });\n            %>\n        </div>\n    </div>\n    <% } \n    var categories = b.getCategories();\n    if (categories.length > 0) { %>\n    <div class="yui3-g srpl-content-container">\n        <div class="yui3-u-1-4">Category</div>\n        <div class="yui3-u-3-4">\n        <%\n            Y.each(categories,function(c,i){%>\n            <a target="<%= Y.srpl.config(\'linking.target\') %>" href="<%= b.getCateoryUrl(c) %>" title="<%= c.name %>"><%= c.name %></a><%= (i === categories.length-1 || i === 0) ? \'\' : \', \' %>\n        <%});%>\n        </div>\n    </div>\n    <% } if (!Y.Lang.isObject(b.get(\'overview\').payment)) { %>\n    <div class="yui3-g srpl-content-container">\n        <div class="yui3-u-1-4">Payment</div>\n        <div class="yui3-u-3-4"><%= b.get(\'overview\').payment %></div>\n    </div>\n    <% } if (!Y.Lang.isObject(b.get(\'overview\').cuisine)) { %>\n    <div class="yui3-g srpl-content-container">\n        <div class="yui3-u-1-4">Cuisine</div>\n        <div class="yui3-u-3-4"><%= b.get(\'overview\').cuisine %></div>\n    </div>\n    <% } if (!Y.Lang.isObject(b.get(\'overview\').ambiance)) { %>\n    <div class="yui3-g srpl-content-container">\n        <div class="yui3-u-1-4">Ambiance</div>\n        <div class="yui3-u-3-4"><%= b.get(\'overview\').ambiance %></div>\n    </div>\n    <% } if (!Y.Lang.isObject(b.get(\'overview\').feature)) { %>\n    <div class="yui3-g srpl-content-container">\n        <div class="yui3-u-1-4">Feature</div>\n        <div class="yui3-u-3-4"><%= b.get(\'overview\').feature %></div>\n    </div>\n    <% } if (!Y.Lang.isObject(b.get(\'overview\').dress_code)) { %>\n    <div class="yui3-g srpl-content-container">\n        <div class="yui3-u-1-4">Attire</div>\n        <div class="yui3-u-3-4"><%= b.get(\'overview\').dress_code %></div>\n    </div>\n    <% } if (!Y.Lang.isObject(b.get(\'overview\').price)) { %>\n    <div class="yui3-g srpl-content-container">\n        <div class="yui3-u-1-4">Price</div>\n        <div class="yui3-u-3-4"><%= b.get(\'overview\').price %></div>\n    </div>\n    <% } %>\n    <div class="actions clearfix">\n        <a href="<%= b.getBusinessUrl() %>" class="f-left" title="View More Details">View More Details</a>\n        <a href="<%= b.getBusinessUrl() %>" class="f-right" title="Suggest an edit">Suggest an edit</a>\n    </div>\n</div>\n<% } %>'),
		full:Y.template('<div class="srpl-header yui3-g">\n    <div class="srpl-hero-container yui3-u-17-24 column1">\n        <%= Y.srpl.Business.templates.hero_container({b:b}) %>\n    </div>\n    <div class="srpl-map yui3-u-7-24 column2"></div>\n</div>\n<div class="srpl-body yui3-g">\n    <div class="yui3-u-17-24 column1">\n        <%= Y.srpl.Business.templates.description({b:b}) %>\n        <%= Y.srpl.Business.templates.gallery({b:b}) %>\n        <%= Y.srpl.Business.templates.reviews({b:b}) %>\n    </div>\n    <div class="yui3-u-7-24 column2">\n    	<%= Y.srpl.Business.templates.details({b:b}) %>\n    </div>\n</div>'),
		gallery:Y.template('<% \n    var photos = b.getThumbnailGalleryPhotos();\n    if (photos.length > 0) { %>\n    <div class="srpl-container">\n        <ul class="srpl-gallery clearfix">\n        <%\n        photos = photos.slice(0,Y.srpl.config(\'business.galleryCount\'));\n        Y.each(photos, function(p,i){ %>\n            <li class="<%=(i===0) ? \'first-child\' : \'\'%> <%=(i===(photos.length-1)) ? \'last-child\' : \'\'%> srpl-gallery-thumbnails">\n                <img src="<%= p %>" alt="<%= b.displayValue() %>"/>\n            </li>\n        <%}); %>\n        </ul>\n    </div>\n<% }%>'),
		hero_actions:Y.template('<ul class="actions clearfix">\n    <li class="first-child">\n        <button title="Send to phone" type="button" class="send-phone transparent">\n            <i class="icon"></i>\n            <div class="text f-right">Send to phone</div>\n       </button>\n    </li>\n    <li>\n        <button title="Directions" type="button" class="directions transparent">\n            <i class="icon"></i>\n            <div class="text f-right">Directions</div>\n       </button>\n    </li>\n    <li>\n        <button title="Share" type="button" class="share transparent">\n            <i class="icon"></i>\n            <div class="text f-right">Share</div>\n       </button>\n    </li>\n    <li class="last-child">\n        <button title="Menu" type="button" class="menu transparent">\n            <i class="icon"></i>\n            <div class="text f-right">Menu</div>\n       </button>\n    </li>\n</ul>'),
		hero_container:Y.template('<div class="srcpl-hero-container">\n    <img class="hero" src="<%= b.get(\'herophoto\') %>" alt="<%= b.displayValue() %>"/>\n    <div class="srcpl-hero-content-container">\n        <h1><%= b.displayValue() %></h1>\n        <h2><%= b.getPrimaryCategory() %></h2>\n        <% if (b.get(\'rating\') && !isNaN(b.get(\'rating\'))) { %>\n        <p class="rating-review">\n            <a target="_blank" href="<%= b.get(\'readreviewsurl\') %>">\n                <span class="rating-static f-left rating-<%= (b.get(\'rating\')*10) %>">\n                    <%= b.get(\'rating\') %> out of 5 stars\n                </span>\n                <% if (b.get(\'nreview\')) {%>\n                (<span class="review">based on </span><%= b.get(\'nreview\') %> reviews)\n                <% } %>\n            </a>\n        </p>\n        <% } if (b.address()) {%>\n        <p class="adr"><%= b.address() %></p>\n        <% } if (b.get(\'phone\')) {%>\n        <p class="tel"><%= b.get(\'phone\') %></p>\n        <% } if (b.get(\'website\') && b.get(\'website\')[\'$\']) {%>\n        <p class="web">\n            <a href="<%= b.get(\'website\')[\'$\'] %>" target="_blank" class="url" title="<%= b.get(\'websitelabel\') || b.get(\'website\')[\'@label\'] %>">\n                <%= b.get(\'webLabel\') %>\n            </a>\n        </p>\n        <% } %>\n        <%= Y.srpl.Business.templates.hero_actions() %>\n    </div>\n</div>'),
		mini:Y.template('<div class="srpl-header">\n    <div class="srpl-hero-container">\n        <%= Y.srpl.Business.templates.hero_container({b:b}) %>\n    </div>\n</div>\n<div class="srpl-body">\n    <div>\n        <%= Y.srpl.Business.templates.description({b:b}) %>\n        <%= Y.srpl.Business.templates.gallery({b:b}) %>\n        <%= Y.srpl.Business.templates.reviews({b:b}) %>\n    </div>\n</div>'),
		reviews:Y.template('<% if (b.get(\'latestreview\') && !Y.Lang.isObject(b.get(\'latestreview\'))) { %>\n<div class="srpl-container">\n    <h3>What people say</h3>\n    <p><%= b.get(\'latestreview\') %></p>\n</div>\n<% }%>')
};
}, '@VERSION@',{
    // [bug 5892107] no need to require assets     
    requires:['srpl-template']
});